export const servicos = [
    {
        id:1,
        titulo:"Manuntenção de Computadores",
        horas:"10h - 18h",
        imagem:imagem_servicos
    },
    {
        id:2,
        titulo:"Manuntenção de Celulares",
        horas:"10h - 18h",
        imagem:imagem_Celular
